import React,{Fragment} from 'react';
let productsArr=[
    {
        id:"s1",
        name:"Sushi",
        items:"fish",
        amount:12
    },
    {
        id:"s2",
        name:"chapathi",
        items:"flour",
        amount:10
    },
    {
        id:"s3",
        name:"curry",
        items:"vegetables",
        amount:5
    },
]
const Products=()=>{
    let List=productsArr.map(item=><li ><h3>{item.name}</h3>
    <h4>{item.items}</h4>{item.amount}
    </li>)
        return(
       <Fragment>    
            <div>
                {List}
            </div>
        </Fragment>
    )
}
export default Products;
